  static String m1(baerenschloss, birkenkopf) =>
      "Umgebung Stuttgart:\n1 | Birkenkopf/Monte Scherbelino\nDer ${birkenkopf}ist der höchste Aussichtspunkt Stuttgarts. Wer möchte, kann ein Stück des Weges mit der Bahn oder dem Bus zurücklegen und den letzten moderaten Anstieg zu Fuß zurücklegen. Wer noch nicht genug hat: Der umliegende Wald bietet schöne Wander- und Spazierwege, die beispielsweise auch zum ${baerenschloss}führen!\n";

  static String m2(zacke) =>
      "10 | Mit der Zacke aus dem Kessel\nMit der ${zacke} könnt ihr vom Marienplatz aus bis nach Degerloch fahren. Dort erwarten euch eine schöne Aussicht, hübsche Villen und nach einem Fußmarsch der Fernsehturm. Von Degerloch zurück in den Kessel führt übrigens der wunderschöne Schimmelhüttenweg, der mitten durch die Weinberge führt und auf dem man durchgehend einen tollen Blick auf Stuttgart hat!Weiterer Bahn-Tipp: In Heslach befindet sich die Standseilbahn, die euch in die 1920er Jahre zurückversetzt. Von Stahlseilen getragen wird man ca. 550 Meter hoch hinauf zum Waldfriedhof gezogen.\n";

  static String m3(ausblicke, siebenmuehlental, grabkapelle, solitude) =>
