    "homeTandemstoryOneBodyOne": MessageLookupByLibrary.simpleMessage(
      "Ein Tandem mit einer Frau, die aus einem anderen Land stammt, zu haben ist eine bereichernde Erfahrung, die ich nicht mehr missen möchte.Makai hatte zunächst vor allem zum Deutschlernen eine hier beheimatete Frau gesucht. Doch auch das gemeinsame Lernen war meistens schon davon begleitet, dass wir gemeinsam Chai getrunken, etwas gegessen, uns ausgetauscht und viel gemeinsam gelacht haben. Ich finde die Zeit, dass man in Form von interessanten Einblicken, neuen Kontakten und einem ganz praktischen kulturellen Lernen tausendmal zurückbekommt.",
    ),
    "homeTandemstoryOneBodyTwo": MessageLookupByLibrary.simpleMessage(
      "Es war ein Kennenlernen für uns beide: Nicht nur ich habe Makai Deutsch und etwas über das Leben hier beigebracht– ich konnte von ihr und ihrer Familie auch total viel über Afghanistan, die Lebensweise dort und auch über die Bedingungen für Geflüchtete hier in Deutschland lernen. Ich finde es total wichtig, als Frau andere Frauen darin zu bestärken, alle Möglichkeiten, die wir haben, für sich zu nutzen. Gemeinsam haben wir auch viele Freizeitaktivitäten in Stuttgart unternommen, waren schwimmen, im Park oder der Bücherei. Da konnte ich meine Stadt selbst nochmal mit ganz anderen Augen kennenlernen und zeigen, was ich hier schätze. Der Verein bietet auch mega schöne und vielseitige Aktivitäten für die ganze Gemeinschaft an, in der man eine interessante Zeit mit anderen Frauen verbringen kann.Ich kann nur jede interessierte Frau ermutigen, selbst auch diese sinnvolle Chance zu nutzen und andere Frauen zu unterstützen!",
    ),
    "homeTandemstoryOneSubTitle": MessageLookupByLibrary.simpleMessage(
      "Erfahrungsbericht der Tandems",
    ),
    "homeVereinInfoOneBody": MessageLookupByLibrary.simpleMessage(
      "Der Verein Female Fellows e.V. setzt sich aktuell insbesondere für die Stärkung von Frauen mit Flucht- und Migrationserfahrung ein. Unter dem Motto „Hinter jeder starken Frau stehen starke Frauen“ möchten wir zum Fempowerment und damit zu einer Gesellschaft beitragen, die ihre Vielfalt lebt und in der alle gleichberechtigt mitgestalten. Die ehrenamtlich vermittelten Tandem-Projekte in Stuttgart, Bietigheim-Bissingen und Tübingen zeichnen sich daher neben sprachlicher und alltäglicher Unterstützung vor allem durch Events und Unternehmungen jeglicher Art aus – denn Begegnungen sind der Schlüssel für einen inspirierenden, helfenden, offenen und horizonterweiternden Umgang miteinander.",
    ),
    "homeVereinInfoOneTitle": MessageLookupByLibrary.simpleMessage(
      "Unsere Mission",
    ),
    "homeVereinInfoThreeBody": MessageLookupByLibrary.simpleMessage(
      "Vielen Dank! Wir möchten uns bei allen Ehrenamtlichen und fleißigen Helfer*innen für ihre Zeit, Geduld und ihre Begeisterung bedanken. Ein großer Dank gilt auch allen unseren Spender*innen und Unterstützer*innen, die an uns glauben und das Projekt so mittragen. Auch unseren vielen Teilnehmer*innen möchten wir herzlich für ihr Vertrauen, ihre Offenheit und ihre Lebensfreude danken! Ohne euch alle wäre das Projekt nur eine fixe Idee geblieben!",
    ),
    "homeVereinInfoThreeButton": MessageLookupByLibrary.simpleMessage(
      "Zu den Kooperationspartner",
    ),
    "homeVereinInfoThreeTitle": MessageLookupByLibrary.simpleMessage(
      "Kooperations-\npartner",
    ),
    "homeVereinInfoTitle": MessageLookupByLibrary.simpleMessage(
      "Über den Verein",
    ),
    "homeVereinInfoTwoBody": MessageLookupByLibrary.simpleMessage(
      "Laut einer aktuellen Studie der OECD werden weibliche Geflüchtete schlechter in die deutsche Gesellschaft integriert. Grund hierfür ist die geringe Teilnahme an Integrationsangeboten und wenig Kontakt zu Einheimischen. Nur 12% der geflüchteten Frauen in Deutschland haben täglich Kontakt zu Einheimischen. Female Fellows möchte diesem Phänomen durch das Tandemprojekt entgegenwirken und einen großen ersten Schritt hin zu einem gelungenen Miteinander machen. Das Tandemprojekt ermöglicht und fördert darüber hinaus den kulturellen Austausch.Diese Frauen haben das Potenzial, die Kapazität und die Fähigkeit zum Handeln! Es geht darum, das Potenzial der Frauen zu nutzen, sie stark zu machen und zu ermutigen!",
    ),
