    "tandemActivityElevenBody": MessageLookupByLibrary.simpleMessage(
      "Ihr wollt sehen oder hören, was eure Umgebung so an Kunst zu bieten hat? Dann informiert euch hier. \nKunst in Stuttgart\n1 | Staatsgalerie \nMittwochs ist der Eintritt in die Sammlung der Stuttgarter Staatsgalerie frei! Die Öffnungszeiten sind 10 bis 18 Uhr. Das Graphik-Kabinett und die Videobox sind im freien Eintritt inbegriffen, Sonderausstellungen allerdings nicht.\n2 | Hitzefrei im Landesmuseum \nAb 25 Grad ist der Eintritt in die kühlen Räume des Landesmuseums im Alten Schloss frei. Das Angebot gilt meist jährlich im August. Zu entdecken gibt es viele spannende Ausstellungen\n3 | Kostenlose Veranstaltungen in der Musikhochschule\nViele Konzerte und Veranstaltungen in der zentral gelegenen Musikhochschule Stuttgart sind kostenlos.\n1 Kunst in Bietigheim-Bissingen\n1 | Stadtmuseum Hornmoldhaus 57 Hauptstraße, 74321 Bietigheim-Bissingen\nwww.stadtmuseum.bietigheim-bissingen.de\nDas Hornmoldhaus in Bietigheim ist eines der besterhaltenen Bürgerhäuser der Renaissance in Süddeutschland. Erbaut wurde das Haus in den Jahren 1535/36 durch den Bietigheimer Vogt Sebastian Hornmold den Älterwen. Besonders sehenswert sind die Innenausmalungen aus der Renaissancezeit. Die Ausstellungsthemen wechseln regelmäßig, der Eintritt ist kostenlos.\n2 | Städtische Galerie\nHauptstraße 60-64, 74321 Bietigheim-Bissingen\nwww.galerie.bietigheim-bissingen.de\nIn der Altstadt Bietigheims findet man die 1989 eröffnete und im Jahre 2000 erweiterte Städtische Galerie Bietigheim-Bissingen – eine gelungene Synthese aus historischer Bausubstanz und moderner Architektur. Mit ihren wechselnden Ausstellungen zur Klassischen Moderne und zur Gegenwartskunst sowie einer umfangreichen Sammlung künstlerischer Linolschnitte und Kunst der Region hat die Städtische Galerie eine anerkannte Position im Kulturgeschehen rund um Stuttgart.",
    ),
    "tandemActivityElevenTitle": MessageLookupByLibrary.simpleMessage(
      "Kunst genießen",
    ),
    "tandemActivityFiveBody": MessageLookupByLibrary.simpleMessage(
      "Ob zu Fuß oder mit dem Rad – deine Umgebung bietet viele tolle Spots und Ausblicke. Zeit zum Durchatmen und für gute Gespräche!",
    ),
    "tandemActivityFiveBody1": m1,
    "tandemActivityFiveBody10": m2,
