    "tandemActivityFiveBody7": m13,
    "tandemActivityFiveBody8": MessageLookupByLibrary.simpleMessage(
      "8 | Bärenschlössle\nHier erwarten euch Entspannung und Natur pur: Das Bärenschlössle liegt mitten im Wald und ist von einer wunderschönen Seelandschaft umgeben. Es lässt sich wunderbar picknicken, im und um das Schlössle befinden sich aber auch ein Restaurant, ein Kiosk und viele Sitzgelegenheiten. Von hier aus kann man u.a. perfekt zum Schloss Solitude spazieren oder den umliegenden Rotwildpark erkunden.\n",
    ),
    "tandemActivityFiveBody9": MessageLookupByLibrary.simpleMessage(
      "9 | Blaustrümpflerweg\nEigentlich startet der Blaustrümpflerweg am Marienplatz, man kann aber auch an anderen Stellen auf der Strecke einsteigen und nur einen Teil der insgesamt 7,5km langen Strecke zurücklegen. Man kommt an verschiedenen Aussichtspunkten und Sehenswürdigkeiten vorbei und ist trotz längerer Abschnitte in der Natur zentrumsnah und gut angebunden an den öffentlichen Nahverkehr. \n",
    ),
    "tandemActivityFiveTitle": MessageLookupByLibrary.simpleMessage(
      "Ab ins Grüne",
    ),
    "tandemActivityFourBody": MessageLookupByLibrary.simpleMessage(
      "Rückblickende Events\n1 | Wachstücher selber machen\n Bei  Gruppentreffen im September 2019 haben wir Wachstücher, als nachhaltige Alternative zu Frischhaltefolie, selbst gemacht.\n2 | Stricken macht glücklich.Thaera aus Afghanistan hat gemeinsam mit ihren Töchtern unseren Stuttgarter Tandems stricken beigebracht.\n",
    ),
    "tandemActivityFourBody2": MessageLookupByLibrary.simpleMessage(
      "Weitere Ideen\n1 | Karten basteln / Handlettering\nOb zu einem bestimmten Anlass oder einfach nur, um einer Person, die euch am Herzen liegt, ein paar Grüße zu überbringen: Lasst euch beispielsweise auf pinterest für Kartenmotive inspirieren oder probiert mal verschiedene Schriftarten oder Techniken des Handlettering aus.\n2 | Fotografieren\nIhr habt Interesse an schönen Motiven und/oder bearbeitet gerne Bilder? Zeigt euch gegenseitig eure Tipps und Tricks. Wenn ihr gerne draußen (in der Natur oder von einem Aussichtspunkt) fotografiert und Ideen für geeignete Spots sucht, könnt ihr euch von der Rubrik Ab ins Grüne inspirieren lassen. Die entstandenen Bilder können dann natürlich auch kreativ weiterverarbeitet werden (z.B. als Kartenmotive).\n3 | Nähen\nAus alten Handtüchern lassen sich wunderbar Kosmetiktücher herstellen! Ihr braucht dazu ein altes Handtuch, einen Stoff für die Rückseite (oft reichen auch Stoffreste, man kann auch alte Jeans oder sonstige Kleidungsstücke aus gewebtem Stoff verwenden), ein Bügeleisen, etwas Karton/dickes Papier für die Schablonen, eine Schere und eine Nähmaschine (notfalls geht es auch mit Nadel und Faden). Tipps, wie ihr vorgehen könnt, findet ihr im DIY-Video auf der rechten Seite.\n",
    ),
    "tandemActivityFourBody3": m14,
    "tandemActivityFourTitle": MessageLookupByLibrary.simpleMessage(
      "Kreativ sein",
    ),
    "tandemActivityNineBody": MessageLookupByLibrary.simpleMessage(
      "Du tanzt gerne? Dann erfahre hier mehr über unterschiedlichste Tänze wie den afghanischen Tanz oder Breakdance.\nInspiration aus dem Rückblick\n1 | Traditioneller Tanz trifft auf urbanen Tanz beim Picknick\nWenn es Mal wieder „Female-Fellows Picknick“ heißt, heißt es auch direkt: Tanzen. Bei all unseren Treffen haben wir angefangen zu tanzen, sobald unsere Musikbox anfängt zu spielen. Ob traditionelle Tänze von unterschiedlichsten Kulturen, moderne Tänze oder Breakdance, das ist ganz egal. Uns geht es vor allem um Spaß und um den Austausch!\n2 | Afghanischer Tanz im Theater\nIm Oktober 2018 gab es eine tolle Veranstaltung zum Thema „unterschiedliche Kulturen“ in der Volkshochschule Stuttgart. Es gab Stände von unterschiedlichen Ländern und Kulturen und natürlich eine Menge gutes Essen. Das Highlight des Tages war eine Tan-Aufführung von diversen traditionellen Tänzen wie z.B. vom Flamenco bis zum afghanisch-traditionellen Tanz.\n3 | Afghanisches Neujahrsfest\nAm afghanischen Neujahrsfest wurden unsere Female Fellows ins kalte Wasser geworfen. Ohne Einführung in den traditionellen afghanischen Tanz musste jede direkt in der Mitte tanzen und der Rest der Gruppe bildete einen Kreis, in dem alle in der Hocke sitzen. Danach ist der nächste dran. Wir hatten eine Menge Spaß zusammen…",
    ),
    "tandemActivityNineTitle": MessageLookupByLibrary.simpleMessage(
      "Gemeinsam tanzen",
    ),
    "tandemActivityOneBody": MessageLookupByLibrary.simpleMessage(
      "Viele unserer Tandems gehen sehr gerne in Cafés zum quatschen, Deutsch lernen oder einfach um sich auszutauschen.Hier findest du eine kleine Liste mit coolen Cafés:",
    ),
    "tandemActivityOneTitle": MessageLookupByLibrary.simpleMessage(
      "Ins Café gehen",
    ),
    "tandemActivitySevenBody": MessageLookupByLibrary.simpleMessage(
      "Du würdest gerne mit deiner Tandempartnerin kochen? Lass dich hier von leckeren Rezepten inspirieren, die exklusiv von einigen Tandems erprobt wurden!\nInspiration aus dem Rückblick\nAfghanische Küche: „Bolani“ Kochabend bei Caro\n Im Oktober 2018 hatten wir einen gemütlichen Kochabend bei Caro organisiert. Unsere Mädels aus Afghanistan haben uns ihre Spezialität „Bolani“beigebracht zu kochen. Hier ist das Rezept:\n1 | Für den Teig Mehl in eine große Schüssel geben. 175 ml Wasser, 2-3 TL Salz und 1 TL Öl zugeben und verkneten, bis der Teig weich wird. Teig noch ca. 2 Minuten weiterkneten und anschließend mit einem Tuch abgedeckt ca. 1 Stunde ruhen lassen.\n2 | Für die Füllung Kartoffeln schälen, vierteln und in Salzwasser ca. 15 Minuten weich kochen.\n3 | Kartoffeln abgießen, 4 TL Öl zugeben und zerstampfen. Lauchzwiebeln und Koriander putzen, waschen und klein hacken. Beides mit den Kartoffeln mischen und mit Salz und Pfeffer würzen.\n4 | Für den Dip den Joghurt in eine Schüssel geben. Knoblauch schälen, hacken und zugeben. Mit Dill, Koriander, Salz und Pfeffer abschmecken.\n5 | Teig in 6 Stücke teilen und jeweils rund ausrollen (ca. 20 cm Durchmesser). Füllung auf je einer Teighälfte verteilen und verstreichen, dabei ca. 1 cm Rand lassen. Freie Teigseite überklappen und die Ränder fest andrücken. Bolani in einer Pfanne mit heißem Öl von jeder Seite 2-3 Minuten braten. Auf ein Stück Küchenpapier legen und abtropfen lassen. Joghurt dazu servieren.\nGuten Appetit!",
    ),
    "tandemActivitySevenBody2": MessageLookupByLibrary.simpleMessage(
      "Arabische Küche: „Auzi“ Online-Kochevent mit Baraa und Thaera\n Im Februar 2021 hatten wir ein gemütliches Online-Kochevent. Baraa und ihre Mutter Thaera haben uns beigebracht, wie man das arabische Gericht „Auzi“ kocht. Hier ist das Rezept (die jeweiligen Mengen hängen von der Anzahl der Essenden ab):\n 1 | Hähnchen in gesalzenem Wasser kochen, nach dem Kochen bei 250 Grad im Backofen goldbraun backen (das Wasser, in dem das Hähnchen gekocht wurde, kann später für den Reis verwendet werden) – als vegetarische Variante kann das Hähnchen durch Tofu (z.B. Räuchertofu mit Mandel), Halloumi, Falafel o.Ä. ersetzt werden \n2| Basmatireis waschen, währenddessen Karotten schälen und in kochendem Wasser weich kochen; bei Bedarf: Erbsen kochen \n3| (Hähnchen-) Wasser zum Kochen bringen (ca. doppelte Menge wie Reis), etwas Salz, Pfeffer, Gemüsebrühe sowie etwas Öl oder Butter (ca. 2 EL) hinzugeben; den gewaschenen Reis beifügen. Nachdem der Reis aufgekocht hat, abgedeckt bei mittlerer Hitze quellen lassen\n4| Etwas Öl oder Butter in einer Pfanne erhitzen, die weichen Karotten in kleine Würfel schneiden und mit Erbsen in die Pfanne geben. Mit Salz, Pfefferminze, Pfeffer und beliebigen Gewürzen abschmecken \n5| In eine weitere Pfanne Öl geben und gut erhitzen, Erdnüsse braun anbraten, etwas später Mandeln hinzugeben und gut rühren (Achtung, kann schnell anbrennen!). Wenn die Nüsse braun angeröstet sind, ca. 2 EL Mais dazugeben\n6| Den fertigen Reis in eine Auflaufform geben, Karotten und Erbsen darauf verteilen, anschließend Mandel/Erdnuss/Mais-Mischung, darauf Hähnchen oder Fleischersatz. Mit Joghurt servieren, je nach Geschmack etwas Zimt hinzugeben.\nGuten Appetit!",
    ),
