    ),
    "tandemActivityThirteenBody": MessageLookupByLibrary.simpleMessage(
      "Die Coronapandemie erlaubt nur Online-Treffen? Lass dich hier für Online-Aktivitäten inspirieren.\n1 | „Offline“-Aktivitäten ins Onlinetreffen verlagern\nEinige Aktivitäten funktionieren sowohl bei face-to-face-Treffen als auch online. Ihr könnt euch in den entsprechenden Rubriken Inspiration holen und euch dann per Videochat (WhatsApp, Skype, Zoom, …) verabreden. Es bietet sich beispielsweise an: Gemeinsam kochen, Kreativ sein (basteln, nähen, stricken, …), Deutsch lernen, Tandemaustausch, …\n2 | Spiele\nViele Spiele lassen sich auch online gut spielen. Einige Ideen, auch für größere Gruppen, findet ihr hier.Über das Whiteboard bei Zoom beispielsweise kann man gut Montagsmaler spielen.Es gibt verschiedene Websites, auf denen man online mit Freunden spielen kann. Tabu, Wer bin ich?, Pantomime, Kniffel, Quiz oder Stadt-Land-Fluss lassen sich aber auch problemlos auf analoge Weise über Videochat spielen.\n3 | Filme/Serien\nIhr könnt über eure Lieblingsfilme und -serien sprechen. Dann schaut ihr den Lieblingsfilm eurer Tandem-Partnerin an und tauscht euch anschließend darüber aus. Oder ihr verabredet euch und seht gleichzeitig etwas an, um euch anschließend auszutauschen.\n4 | Bewegung …\n… darf auch in Zeiten von social distancing nicht zu kurz kommen! Spazierengehen ist immer eine gute Lösung. Ihr könnt die frische Lust genießen, neue Parks und Wege entdecken oder euch in der Rubrik Ab ins Grüne inspirieren lassen. Draußen kann man auch gut Abstand halten und Maske tragen, um das Infektionsrisiko zu minimieren.Wenn euch gemeinsame Spaziergänge zu riskant sind, könnt ihr euch für ein gemeinsames Workout, gemeinsames Tanzen oder Yoga verabreden, indem ihr z.B. dasselbe Workout-Video macht und gleichzeitig per Videochat mit eurer Tandempartnerin verbunden seid. Oft ist man zu zweit motivierter als allein!",
    ),
    "tandemActivityThirteenBody2": m21,
    "tandemActivityThirteenTitle": MessageLookupByLibrary.simpleMessage(
      "Digitale Aktivitäten",
    ),
    "tandemActivityThreeBody": MessageLookupByLibrary.simpleMessage(
      "Du spielst ein Instrument oder kannst singen? Dann teile diese Leidenschaft mit deiner Tandem-Partnerin und/oder verbinde dich mit unseren FF-Musikerinnen.\n\n1 | Drauf los singen/spielen\nEs gibt zahlreiche Playbacks und Tutorials auf Youtube, mit denen ihr einfach mal ausprobieren könnt, was eure Stimme so hergibt und worauf ihr Lust habt. Dasselbe gilt natürlich auch für Instrumente, solltet ihr beispielsweise eine Gitarre haben. Wenn eine von euch schon ein Instrument spielen kann, könnt ihr euch auch gegenseitig Tipps zeigen, wie man es erlernt oder einfach zusammen Lieder singen oder spielen.\n",
    ),
    "tandemActivityThreeBody2": m22,
    "tandemActivityThreeBody3": MessageLookupByLibrary.simpleMessage(
      "3 | Gemeinsam Musik hören und Geschmäcke austauschen\nAn regnerischen Tagen, aber auch bei einem gemeinsamen Picknick oder Spaziergang könnt ihr statt eines Filme- oder Kochabends auch mal austauschen, welche Musik euch gefällt. Vielleicht stoßt ihr auch gemeinsam auf neue Musik, die euch beiden gefällt?\nInspiration aus dem Rückblick\nGemütliches Zusammenkommen in Bietigheim-Bissingen\nIm September 2019 organisierte die Projektkoordinatorin Masooma Torfa ein Treffen für alle Interessiert am Tandem-Projekt. Bei leckeren süßen Stückchen verzauberte Fatima uns mit ihrer tollen Stimme./nDu spielst ein Instrument oder kannst singen? Du würdest dich gerne mit anderen FF-Musikerinnen verbinden? Du möchtest weitere Ideen zum Thema Musik machen weiterempfehlen? Oder einen Musik-Workshop anbieten? Dann schreibe uns eine Mail an info@femalefellows.com mit dem Betreff „Musik machen“ ",
    ),
    "tandemActivityThreeTitle": MessageLookupByLibrary.simpleMessage(
      "Musik machen",
    ),
    "tandemActivityTwelveBody": MessageLookupByLibrary.simpleMessage(
      "Ihr wollt wissen, was es abseits der Königstraße und des Schlossparks in der Stuttgarter Stadtmitte zu sehen und unternehmen gibt? Dann informiert euch hier.\n1 | Marktvielfalt genießen\nNeben den Wochenmärkten gibt es zahlreiche Flohmärkte, wie z.B. den großen Frühjahrs- oder Herbstflohmarkt oder den wöchentlichen Flohmarkt, der jeden Samstag auf dem Karlsplatz stattfindet. Übrigens: Vom Karlsplatz aus lohnt sich immer auch ein Abstecher in die Markthalle!\n2 | Stadtgeschichte am Bahnhof erfahren\nWer sich gern Informationen und einen Überblick rund um Stuttgart 21 oder einfach nur einen Blick über den Stadtmittelpunkt verschaffen will, kann das auf dem 56 Meter hohen Bahnhofsturm tun. Der Eintritt ist frei, hoch könnt ihr immer über Aufzüge, die von der Bahnhofshalle aus zu erreichen sind. Geöffnet ist der Turm Montag bis Mittwoch und Freitag von 9 bis 19 Uhr, donnerstags 10 bis 21 Uhr (eure Chance auf einen Sonnenuntergang mit Aussicht!), samstags und sonntags von 10 bis 18 Uhr.\nDu möchtest einen interessanten Spot in der Innenstadt weiterempfehlen? Schreibe uns eine Mail an info@femalefellows.com mit dem Betreff „Stuttgarts Innenstadt erkunden“, in der du kurz beschreibst, worum es sich bei deiner Empfehlung genau handelt und was sie besonders macht.",
    ),
    "tandemActivityTwelveTitle": MessageLookupByLibrary.simpleMessage(
      "STUTTGART-CITY ERKUNDEN",
    ),
    "tandemActivityTwoBody": MessageLookupByLibrary.simpleMessage(
      "Es geht nichts über ein gemeinsames Picknick mit deiner Tandempartnerin. Erfahre hier, was ihr dafür alles braucht.\n\nDie besten Locations in Stuttgart:\n1 | Max-Eyth-See:\nDer Max-Eyth-See ist unser Favorit zum Picknicken. Ob Grillen, sportliche Aktivitäten, Boot fahren auf dem See oder einfach nur gemütlich zusammen sitzen…\n2 | Schlossgarten\nDer Schlossgarten ist der zentralste Park um sich gemeinsam zum Picknicken zu treffen. Man kann sich auch schnell Kaffee und Snacks aus der Stadt holen und dann gemütlich im Park sitzen.\n3 | Teehaus\nEiner der schönsten Aussichtspunkte über Stuttgart.\n4 | Santiago de Chile Platz\nPicknick mit Aussicht über Stuttgart. Allerdings oft sehr voll und keine Grünfläche.\n",
    ),
    "tandemActivityTwoBody2": MessageLookupByLibrary.simpleMessage(
      "  Die besten Locations in Bietigheim-Bissingen:\n 1 | Stadtgarten Bietigheim\nSchön gepflegte Grünflächen zwischen Blumengärten und dem Fluss Enz. Man findet hier immer ein Plätzchen zum Relaxen und Picknicken. Wer sich gerne sportlich betätigen möchte, der darf sich hier mit Outdoor-Aktivitäten vergnügen. Ob bei einer Runde Federball, Wikingerschach, Tanzen oder Yoga – der wunderschöne Park in Bietigheim bietet dafür die ideale Möglichkeit. Wer sich lieber auf dem Wasser austobt, der kann sich beim Verleih der Zugvögel in der Holzgartenstraße 18, 74321 Bietigheim-Bissingen ein Kajak oder SUP mieten und das kühle Nass genießen.\n",
    ),
    "tandemActivityTwoBody3": MessageLookupByLibrary.simpleMessage(
      " Die besten Locations in Tübingen:\n1 | Alter Botanischer Garten („Bota“)\nDer Bota ist vor allem im Sommer the place to be. Ob einfach nur zum gemütlichen Picknicken, Slacklinen, Frisbee-Spielen oder zum Wikingerschach – es ist eigentlich immer etwas los.\nWas mitbringen?\n1 | Spiele für Sport\nOb Federball, Volleyball, Tischtennis oder Boul: Bewegung an der frischen Luft tut jedem gut!\n2 | Musikbox \nDem gemeinsamen Tanzen oder dem Austausch über die neuste Lieblingsmusik steht so nichts mehr im Wege!\n3 | Picknickdecke\n4 | Besteck\nSnacks zum mitnehmen:\n1 | Tabule:\nDieser köstliche Salat mit frischer Petersilie ist besonders an heißen Tagen ein erfrischender Genuss!\n2 | Pizza- oder Blätterteigtaschen:\nBesonders handlich kommen Pizza- und Blätterteigtaschen daher. Besteck vergessen? Kein Problem!\n3 | Gemüse oder (selbstgebackenes) Brot mit Dips:\nMit Joghurt, Kräutern, Gewürzen und Feta beispielsweise lässt sich ein leckerer, erfrischerender Dip zaubern. Kurz ein wenig Brot oder Gemüse kleingeschnitten und schon ist für Snacks gesorgt!\n",
    ),
    "tandemActivityTwoBody4": MessageLookupByLibrary.simpleMessage(
      "  Weitere schöne Plätze und Ausflugsziele für ein Picknick findest du in der Rubrik Ab ins Grüne. Du hast mit deiner Tandempartnerin weitere schöne Spots zum Picknicken entdeckt oder möchtest Rezepte, Ideen für Spiele o.Ä. weiterempfehlen? Schreibe uns eine Mail an info@femalefellows.com (a ref= mailto:infor@femalefellows.com) mit dem Betreff „Picknicken“",
    ),
