    "tandemSecondStepnoslash": MessageLookupByLibrary.simpleMessage(
      "2 | Der Tandem-Matching-Prozess:",
    ),
    "tandemSlogan": MessageLookupByLibrary.simpleMessage(
      "Das Female Fellows Tandemprojekt verbindet Frauen mit und ohne Flucht- und Migrationserfahrung. ",
    ),
    "tandemSloganBody": MessageLookupByLibrary.simpleMessage(
      "Das Female Fellows Tandemprojekt verbindet Frauen mit und ohne Flucht- und Migrationserfahrung. Bei diesem ehrenamtlichen Integrationsprojekt werden Frauen mit Flucht- und Migrationserfahrung beispielsweise beim Spracherwerb, bei Behördengängen, im Alltag und in Ausbildung und der Integration auf dem deutschen Arbeitsmarkt unterstützt. Dabei entstehen Freundschaften, ein spannender Austausch zwischen unterschiedlichen Kulturen und jede Menge Spaß.",
    ),
    "tandemStory2Body": MessageLookupByLibrary.simpleMessage(
      "Es ist ein ziemlich kalter Oktobertag als Jana und ich uns mit Yasna und Franziska treffen. Dadurch, dass es zu laut ist in dem Café, beschließen wir, für das Interview nach draußen zu gehen.\n Es ist schon ziemlich abgekühlt, doch dick eingepackt und mit Tee und heißer Schokolade machen Jana und ich uns daran, eines unserer Tandems besser kennenzulernen. \nFranziska und Yasna erzählen mir, dass ihr erstes Treffen sehr schön war. Beide gingen damals spazieren, um sich besser kennenzulernen.  \nAls ich die beiden Frauen frage, wie viel sich seit dem letzten Treffen getan hat, erzählen sie, dass sich viel getan habe. Gedanken, ob sie denn zusammenpassen würden, trotz so unterschiedlicher Kulturen, begleiteten beide.  Doch als sie sich näher kennenlernten, verflogen diese Zweifel sehr schnell. \nYasna kommt ursprünglich aus Afghanistan und ist in Deutschland mit ihrem Bruder und ihren Eltern. Ihre große Leidenschaft ist das Tanzen, welche sie auch in Stuttgart weiterverfolgt. Anfangs war sie noch sehr schüchtern und zurückhaltend aufgrund der unterschiedlichen Kultur, die Deutschland als gebürtige Afghanin bietet.",
    ),
    "tandemStory2Body1": MessageLookupByLibrary.simpleMessage(
      "Franziska lebt erst seit kurzem wieder in Stuttgart, sie erzählt uns, dass sie für den Job hergezogen sei und sich vor allem für Frauen engagieren wolle. Durch das Internet ist sie dann auf Female Fellows gestoßen. \nAls ich Franziska frage, was ihr an Yasna gefalle, erzählte sie uns, dass sie Yasna für ihre Stärke bewundere und für das, was sie alles schon in ihrem jungen Leben geschafft hat. Yasna lächelte gerührt und dann gewähren uns Yasna und Franziska Einblicke in ihre gemeinsamen Treffen und die Probleme, denen sie oft begegnen.\nYasna lebte lange Zeit in einer Gemeinschaftsunterkunft mit ihren Eltern zusammen und hatte keinen Rückzugsort. Glücklicherweise hat sich jetzt etwas getan, denn sie hat eine eigene Wohnung, worüber sie sehr froh ist. Jedoch hatte sie dort kein Internet, da sie im Keller wohnt und keinen Empfang hat. Sie wünsche sich sehr, Internet zu haben, denn so kann sie leichter mit ihren Freunden und Verwandten aus Afghanistan kommunizieren und natürlich auch mit ihren Eltern.",
    ),
    "tandemStory2Body2": MessageLookupByLibrary.simpleMessage(
      "Nicht nur deswegen, sondern auch für den Deutschkurs brauche sie oft besseres Internet als es ihr mobiles Internet zulässt. Sie muss oft Wörter nachschlagen oder würde auch gerne Videos anschauen, mit denen sie Deutsch lernen kann. Yasna macht gerade noch einen Deutschkurs und würde später sehr gerne eine Ausbildung machen. \nFranziska hilft ihr bei der Suche nach einem bezahlbaren Internet­anbieter, aber es sei nicht sehr leicht. Beide wünschen sich mehr Unterstützung. \nDie Atmosphäre die uns dieses innige Gespräch bat, werde ich so schnell nicht vergessen. Man merkt, dass Yasna und Franziska sich gegenseitig sehr ans Herz gewachsen sind und dass sie beide sehr froh sind sich kennengelernt zu haben.\n Beiden Frauen macht es sehr viel Spaß sich miteinander zutreffen. Insgesamt war es eine sehr schöne Begegnung, Jana und ich sind schon gespannt, wen wir als nächstes kennenlernen dürfen.",
    ),
    "tandemStory2Title": MessageLookupByLibrary.simpleMessage(
      "FREUNDSCHAFT AUF DEN ERSTEN BLICK",
    ),
    "tandemStory3Body1": MessageLookupByLibrary.simpleMessage(
      "Zouzan und Sandra haben sich Anfang des Jahres kennengelernt. Gematched wurden die beiden bereits im März, konnten sich aufgrund des Lockdowns aber erst im Juli persönlich treffen. Ihr erstes Treffen haben sie bei einer Fahrradtour 🚲durch Bietigheim-Bissingen verbracht, um ihre Stadt 🌃 ein bisschen besser kennenzulernen. Das war eines ihrer schönsten Treffen meinen beide. Momentan sehen sie sich wegen der Corona-Krise leider nicht so häufig, aber sie chatten trotzdem regelmäßig miteinander, um in Kontakt zu bleiben.",
    ),
    "tandemStory3Body2": MessageLookupByLibrary.simpleMessage(
      "Sandra erzählt uns, dass sie erst durch das Tandemprojekt erkannte, wie viele Hürden Menschen, die nach Deutschland 🇩🇪 kommen, überwinden müssen. Sie ist immer wieder davon erstaunt, wie toll Zouzan ihren Alltag in Deutschland meistert. Gerne kochen 🥘 sie auch zusammen und lernen sich und die Kultur des anderen dadurch besser kennen. Sandra sagt, dass Zouzan eine Powerfrau 🦹‍♀️sei. Zouzan lernt auch abends noch Deutsch und macht gerade ein Praktikum im Pflegeheim. Zouzan ist alleine in Deutschland und freut sich darüber, mit Sandra jemanden an ihrer Seite zu haben. Als wir beide fragen, was ihnen am meisten an ihrer Tandem-Partnerin gefällt, antwortet Zouzan, dass sie eine sehr gute Freundin dadurch gewonnen habe. Dies bejaht auch Sandra lächelnd.",
    ),
    "tandemStorys": MessageLookupByLibrary.simpleMessage("Tandem-Stories"),
    "tandemThirdStep": MessageLookupByLibrary.simpleMessage(
      "3 | Das Kennenlernen",
    ),
    "tandemThirdStepBody": MessageLookupByLibrary.simpleMessage(
      "Du wohnst schon länger in Deutschland und möchtest dich für ein gutes Zusammenleben ALLER stark machen, und bist an einem kulturellen Austausch interessiert? Dann bist du genau richtig für unser Tandem-Projekt. Wir suchen eine passende Tandem-Partnerin für dich, die deinen kulturellen Horizont erweitern wird und sich im Gegenzug über deine Unterstützung freut. In zusätzlichen monatlichen Gruppenveranstaltungen kannst du dich mit anderen Tandems austauschen und an spannenden Events teilnehmen.",
    ),
    "tandemThirdStepBody2": MessageLookupByLibrary.simpleMessage(
      "Du bist entweder neu in Deutschland oder wohnst schon länger in Deutschland? Du wünschst dir eine Freundin zum Austauschen oder Kontakt zu Frauen, die sich gut in Deutschland und in deiner Umgebung auskennen? Dann bist du genau richtig bei uns! Wir suchen eine passende Tandem-Partnerin für dich, die dir hilft, dich in Deutschland wohlzufühlen. In zusätzlichen monatlichen Gruppenveranstaltungen kannst du dich mit anderen Tandems austauschen und an spannenden Events teilnehmen.",
